【楽天BOX受取対象商品（レディースファッション）】<!--ピックアップイベント//--
<div class="mb_10"></div>
<!--//ピックアップイベント-->

<style type="text/css">

/* お気に入り商品差し替えタグ */
#rakutenLimitedId_aroundCart #serviceTableSml td.favorite {
padding-top: 5px;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm {
width: 230px !important;
height:60px !important;
padding: 0px 0px 10px 0px !important;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm a.addBkm {
width: 230px !important;
height:60px !important;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm a.addBkm span.bkmStar {
display: inline-block !important;
width: 230px !important;
height:60px !important;
margin:0px 0px 10px 0px !important;
background: url("http://image.rakuten.co.jp/amarilyn/cabinet/03994182/04014655/f_item2.gif") no-repeat !important;
}

/* お気に入りショップ差し替えタグ */
div.bookmarkArea {
width: 230px !important;
}
#rakutenLimitedId_aroundCart div.shopBookmarkArea div.shopBkm {
width: 230px !important;
height:60px !important;
padding: 0px 0px !important;
padding-left: 0px !important;
}
#rakutenLimitedId_aroundCart div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar {
display: inline-block !important;
width: 230px !important;
height:60px !important;
margin-right: 0px !important;
background: url("http://image.rakuten.co.jp/amarilyn/cabinet/03994182/04014655/f_shop2.gif") no-repeat !important;
}

#floatbanner a{bottom: 25px !important;/*画面下からどの位置に出したいか*/
left: 20% !important;
}
/* ふろー*/
#floatbanner {
display: block;
width: 960px;/*フロートバナーの横幅*/
height: 70px;/*バナーの縦幅*/
line-height: 38px;
margin: 0;
padding: 0;
position: fixed;
bottom: 0px;/*画面下からどの位置に出したいか*/
left: 20%;/*画面左からどの位置に出したいか*/

text-align: center;
font-weight: bold;

z-index:9005;}

</style>
<!--フローティング//-->
<link href="http://www.rakuten.ne.jp/gold/amarilyn/js/float.js" type="text/javascript">
<div id="floatbanner">

</div>
<!--//フローティング-->

